import React from "react";
import PostsCatalog from "../components/PostsCatalog";
import { useParams } from "react-router-dom";

const DUMMY_POSTS = [
  {
    id: "p1",
    imageUrl:
      "https://tanglesandtravels.com/wp-content/uploads/2016/08/Sunset-in-Calatagan-Batangas_Small.jpg",
    address: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    location: {
      lat: 14.5525375,
      lng: 121.0230466,
    },
    creator: "u1",
  },
  {
    id: "p2",
    imageUrl:
      "https://a0.muscache.com/im/pictures/1fd1596d-1ef4-45d6-82c1-866915b50945.jpg?aki_policy=x_large",
    address: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    location: {
      lat: 13.9634176,
      lng: 120.6374395,
    },
    creator: "u2",
  },
];

const UserPosts = (props) => {
  const userId = useParams().userId;
  const timeLinePosts = DUMMY_POSTS.filter((post) => post.creator === userId);
  return <PostsCatalog bits={timeLinePosts} />;
};

export default UserPosts;
